import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { FaChevronLeft, FaChevronRight } from 'react-icons/fa';

const GMViewPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [profiles, setProfiles] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const profilesPerPage = 3;
  const [gameLog, setGameLog] = useState({ discoveries: [], battles: [], notes: [] });

  useEffect(() => {
    const fetchProfiles = async () => {
      try {
        const url = `http://localhost:5001/campaigns/${id}/profiles`;
        console.log('Fetching from:', url);

        const response = await fetch(url, { headers: { 'Cache-Control': 'no-cache' } });
        const text = await response.text();
        console.log('Raw Response:', text);

        const data = JSON.parse(text);
        console.log('Parsed JSON:', data);

        setProfiles(data);
      } catch (error) {
        console.error('Error fetching profiles:', error);
      }
    };   
    fetchProfiles();
  }, [id]);

  useEffect(() => {
    const fetchGameLog = async () => {
      try {
        const url = `http://localhost:5001/campaigns/${id}/gamelog`;
        const response = await fetch(url, { headers: { 'Cache-Control': 'no-cache' } });
        const data = await response.json();
        setGameLog(data);
      } catch (error) {
        console.error('Error fetching game log:', error);
      }
    };
    fetchGameLog();
  }, [id]);

  const handleNext = () => {
    if (currentIndex + profilesPerPage < profiles.length) {
      setCurrentIndex(currentIndex + 1);
    }
  };

  const handlePrev = () => {
    if (currentIndex > 0) {
      setCurrentIndex(currentIndex - 1);
    }
  };

  const handleBackToCampaigns = () => {
    navigate('/');
  };

  return (
    <div className="gm-view-container">
      <h1>GM view for campaign ID: {id}</h1>

      <button onClick={handleBackToCampaigns} className="back-to-campaigns-button">
        Campaigns
      </button>

      <div className="profile-carousel">
        <button className="nav-button" onClick={handlePrev} disabled={currentIndex === 0}>
          <FaChevronLeft />
        </button>
        <div className="profile-list">
          {profiles.slice(currentIndex, currentIndex + profilesPerPage).map((profile) => (
            <div key={profile.id} className="profile-card">
              <p>{profile.name}</p>
            </div>
          ))}
        </div>
        <button className="nav-button" onClick={handleNext} disabled={currentIndex + profilesPerPage >= profiles.length}>
          <FaChevronRight />
        </button>
      </div>

      <div className="game-log">
        <h2>Game Log</h2>
        <div className="game-log-section">
          <h3>Discoveries</h3>
          <ul>
            {gameLog.discoveries.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
        <div className="game-log-section">
          <h3>Battles</h3>
          <ul>
            {gameLog.battles.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
        <div className="game-log-section">
          <h3>Notes</h3>
          <ul>
            {gameLog.notes.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default GMViewPage;
